    return(
        <div>
            <Header />
            <Note />
            <Cards name="Ravi" placeholder="enter your text1" />
            <Cards name="Pandey" placeholder="enter your text2" />
            <Cards name="Test" placeholder="enter your text3" />
            <Footer />
        </div>
    );
};

export default App;
